import React from 'react';
import './CleanPlaylist.css';
import SpotifyWebApi from 'spotify-web-api-js';
const spotifyApi = new SpotifyWebApi();

class CleanPlaylist extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      ownerId: ''
    };
  }

  getUserProfile(){
    spotifyApi.getMe()
      .then((response) => {
        console.log(response)
        this.setState ({
          ownerId: response.id
        })
      })
  }

  componentDidMount(){
    this.getUserProfile()
  }

  getTracksData(){
    spotifyApi.getPlaylistTracks(this.state.ownerId)
      .then((response) => {
        console.log(response)
      })


  }

  render(){
    return(
      <div>
      <button type="button" className="btn btn-lg btn-success" onClick= {this.getTracksData}>Clean Playlist</button>
      </div>
    )
  }
}

export default CleanPlaylist
